import React, {Fragment} from 'react';

function HeaderCartButton(){

    return (
        <button>
            <span><i class="fas fa-shopping-cart"></i></span>
            <span>Your Cart</span>
            <span>3</span>
        </button>
    );
}

export default HeaderCartButton;
